import React from 'react'
import Card from '../../layouts/Card'
import ButtonLink from '../../components/ButtonLink'
import SubTitle from '../../components/SubTitle'
import TextInput from '../../components/TextInput'
import RadioToggle from '../../components/RadioToggle'
import { courseTypeToggles } from '../../utils/toggleData'

export default function CourseInformation(): JSX.Element {
  return (
    <div>
      <div className="card-container">
        <Card>
          <>
            <SubTitle title="Course Information" />
            <div className="input-container">
              <TextInput placeHolder="Enter course name" />
            </div>
            <SubTitle title="Course Type" />
            <div className="input-container">
              <RadioToggle toggleValues={courseTypeToggles} />
            </div>
          </>
        </Card>
      </div>
      <div className="button-container">
        <ButtonLink label="Start Course" link="/holes/one" />
      </div>

      <style jsx>{`
        .card-container {
          margin-top: 6em;
          margin-bottom: 3em;
        }

        .button-container {
          margin-left: auto;
          margin-right: auto;
          margin-bottom: 20px;
          max-width: 400px;
        }

        .input-container {
          text-align: center;
          width: 100%;
          margin-bottom: 2em;
        }
      `}</style>
    </div>
  )
}
